import React from 'react';
import { useParams } from 'react-router-dom';

import {
  styTitle,
  styContainer,
  styContainerBtn,
  stySku,
  styInventoryName,
  styContainerPrice,
  styContainerSupplier,
  styContainerInventory,
} from './style';

const InventoryDetail = () => {
  let { id } = useParams();

  return (
    <div className={styContainer}>
      <div className={styContainerBtn}>
        <div>Back </div>
        <div>Edit </div>
      </div>
      <h1 className={styTitle}>Inventory Detail</h1>
      <div className={styContainerInventory}>
        <div>
          <div className={stySku}>Sku</div>
          <div className={styInventoryName}>Nama Product</div>
        </div>
        <div className={styContainerPrice}>
          <div>
            <div>Cost Price</div>
            <div>retail Price</div>
          </div>
          <div>qty</div>
        </div>
      </div>

      <div className={styContainerSupplier}>
        <div>Supplier</div>
        <h3>Nama Supplier</h3>
        <div>Alamat</div>
      </div>
    </div>
  );
};

export default InventoryDetail;
